webpackJsonp([0xe7e71a1f3d68],{353:function(e,t){e.exports={data:{site:{siteMetadata:{title:"Ulises Avila",profesion:" - Web Developer"}},markdownRemark:{html:'<h2 id="introduction"><a href="#introduction" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Introduction</h2>\n<p>There will be moments in which you need to move around your data between different database softwares. Fortunately RethinkDB can take data from JSON and CSV files exported from other services as MySQL or PostgreSQL.</p>\n<h2 id="requeriments"><a href="#requeriments" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Requeriments</h2>\n<ul>\n<li>A running RethinkDB installation.</li>\n<li>The python package <code class="language-text">rethinkdb</code> installed to your machine with <code class="language-text">pip</code>. The <code class="language-text">import</code> tool to perform data importing is bundled in that package. It is recommended to use the Python 3 version package, as Python 2 is reaching its end of life soon.</li>\n</ul>\n<h2 id="preparing-the-data"><a href="#preparing-the-data" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Preparing the data</h2>\n<p>For this tutorial you will need two files, one <code class="language-text">json</code> and one <code class="language-text">csv</code>. Preferably placed in your <code class="language-text">home</code> folder. Something important to note is that you do not need to already have created your destination table because RethinkDB takes care of it.</p>\n<p>The first file is called <code class="language-text">temp_data1.json</code>, and should contain the following contents:</p>\n<div class="gatsby-highlight">\n      <pre class="language-text"><code class="language-text">[\n  {\n    &quot;id&quot;: 1, &quot;day&quot;: &quot;monday&quot;, &quot;max&quot;: 23, &quot;min&quot;: 12\n  },\n  {\n    &quot;id&quot;: 2, &quot;day&quot;: &quot;tuesday&quot;, &quot;max&quot;: 22, &quot;min&quot;: 12\n  },\n  {\n    &quot;id&quot;: 3, &quot;day&quot;: &quot;wednesday&quot;, &quot;max&quot;: 23, &quot;min&quot;: 12\n  },\n  {\n    &quot;id&quot;: 4, &quot;day&quot;: &quot;thursday&quot;, &quot;max&quot;: 24, &quot;min&quot;: 12\n  },\n  {\n    &quot;id&quot;: 5, &quot;day&quot;: &quot;friday&quot;, &quot;max&quot;: 25, &quot;min&quot;: 12\n  },\n  {\n    &quot;id&quot;: 6, &quot;day&quot;: &quot;saturday&quot;, &quot;max&quot;: 26, &quot;min&quot;: 13\n  },\n  {\n    &quot;id&quot;: 7, &quot;day&quot;: &quot;sunday&quot;, &quot;max&quot;: 27, &quot;min&quot;: 13\n  }\n]</code></pre>\n      </div>\n<p>And the second one is called <code class="language-text">temp_data2.csv</code> with the following contents:</p>\n<div class="gatsby-highlight">\n      <pre class="language-text"><code class="language-text">id, day, max, min\n8, &#39;monday&#39;, 24, 12\n9, &#39;tuesday&#39;, 21, 11\n10, &#39;wednesday&#39;, 26, 14\n11, &#39;thursday&#39;, 24, 13\n12, &#39;friday&#39;, 25, 12\n13, &#39;saturday&#39;, 25, 10\n14, &#39;sunday&#39;, 22, 14</code></pre>\n      </div>\n<p>Note that it is recommended to use commas as separators for the second file. Also check that you have your RethinkDB instance running in the way you are more confortable with.</p>\n<h2 id="importing-the-json-file"><a href="#importing-the-json-file" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Importing the JSON file</h2>\n<p>After having created the files you are ready to import data. You will use the <code class="language-text">import</code> command of RethinkDB with the name of the file and the name of the table where data will be stored. In this case data is going to be in <code class="language-text">test</code> database.</p>\n<div class="gatsby-highlight">\n      <pre class="language-text"><code class="language-text">rethinkdb import -f temp_data1.json --table test.TempData1</code></pre>\n      </div>\n<p>Then you will get a message with the amount of rows imported to your table.</p>\n<h2 id="importing-the-csv-file"><a href="#importing-the-csv-file" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Importing the CSV file</h2>\n<p>Importing a CSV file is just as easy as importing a JSON file, you just have to specify the file format with the <code class="language-text">--format</code> option:</p>\n<div class="gatsby-highlight">\n      <pre class="language-text"><code class="language-text">rethinkdb import -f temp_data2.csv --table test.TempData2 --format csv</code></pre>\n      </div>\n<p>Again, you will get the amount of rows imported to your table. Note that this time you are importing to different table.</p>\n<h2 id="wrapping-things-up"><a href="#wrapping-things-up" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Wrapping things up</h2>\n<p>After having success importing data to your database, it is time to query it so you can see it. Run each command separately in the Web Panel located at <code class="language-text">localhost:8080</code> in the <code class="language-text">Data Explorer</code> section:</p>\n<div class="gatsby-highlight">\n      <pre class="language-text"><code class="language-text">r.db(&#39;test&#39;).table(&#39;TempData1&#39;)\nr.db(&#39;test&#39;).table(&#39;TempData2&#39;)</code></pre>\n      </div>\n<p>There is difference between both queries\' result, everything in a CSV is imported as string, you must either convert the already imported data in RethinkDB or transform the CSV to JSON with specialized tools.</p>\n<p>To finish this part keep in mind that in the case you already created the destination tables in the database just add the <code class="language-text">--force</code> option to your command to force data writing to those tables.</p>\n<h2 id="conclusion"><a href="#conclusion" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Conclusion</h2>\n<p>RethinkDB provides a fast and useful tool for importing data. Fortunately for us, the tools used in this tutorial can be automated with the help of programming languages and its respective bindings. With this we can incorporate data from external service in a breeze.</p>',frontmatter:{date:"13 June, 2018",path:"/importing-from-external-sources/",title:"Importing data from external sources to RethinkDB",category:"rethinkdb",foreword:"RethinkDB can import data form any source as long as it complies some requirements."}}},pathContext:{id:"/home/ulises/Sites/ulises-site/src/pages/posts/rethinkdb/importing-data/importing-data.md absPath of file >>> MarkdownRemark"}}}});
